import { Link } from "react-router-dom";
import "./style.css";

const Post = ({ post }) => {
  console.log(post);
  return (
    <div>
      <div className="post">
        <div className="post_header">
          <Link
            to={`/profile/${post.user.username}`}
            className="post_header_left"
          >
            <img src={post.user.picture} alt="" />
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Post;
